#Alphabeticaliser is only used for testing locales, inaccessible from the GUI.
Function Alphabeticaliser
{
    $genOutput.Text = -join ($Locales.($lInput.Text) | %{[char]$_})
}

#Creates a string out of randomly choosen characters from the desired locale and arranges them into keys,
#separating each one by the delimiter and outputting the result to a textbox.
Function Generator
{
    $genBar.Value   = 0
    $genOutput.Text = ""

    for ($i = 1; $i -le $ff2Input.Text; $i++)
    {
        $s = for ($j = 1; $j -le $ff1Input.Text; $j++)
        {
            -join (1..$ff0Input.Text | ForEach {($Locales.($lInput.Text) | Get-Random | %{[char]$_})})
        }

        $k = (-split $s) -join $dInput.Text
        $genBar.Value += ($genBar.Maximum - 200) / $ff2Input.Text
        $genOutput.AppendText($k + "`r`n")

        Start-Sleep -m 0.5
    }

    $genBar.Value = $genBar.Maximum
}

#Internal Image Handling
