#GUI Behaviour
ForEach ($i in $ff0Input,$ff1Input,$ff2Input)
{
    $i.Add_TextChanged({
        if ($this.Text -match "[^0-9]")
        {
            $CursorPos = $this.SelectionStart
            $this.Text = $this.Text -replace "[^0-9]",""
            $this.SelectionStart = $this.Text.Length
        }
    })
}

ForEach ($i in $ff0Input,$ff1Input,$ff2Input,$dInput)
{
    $i.Add_TextChanged({
        if ($ff0Input.Text.Length -ne 0 -and $ff1Input.Text.Length -ne 0 -and $ff2Input.Text.Length -ne 0 -and $dInput.Text.Length -ne 0 -and $lInput.Text.Length -ne 0)
        {
            $genButton.Enabled = $true
        }
        else
        {
            $genButton.Enabled = $false
        }
    })
}

$lInput.Add_SelectedIndexChanged({
    if ($lInput.Text -match "--")
    {
        $genButton.Enabled = $false
        $lInput.SelectedIndex = -1
    }

    if ($ff0Input.Text.Length -ne 0 -and $ff1Input.Text.Length -ne 0 -and $ff2Input.Text.Length -ne 0 -and $dInput.Text.Length -ne 0 -and $lInput.Text.Length -ne 0)
    {
        $genButton.Enabled = $true
    }
    else
    {
        $genButton.Enabled = $false
    }
})

$genOutput.Add_TextChanged({
    if ($genOutput.Text.Length -ne 0)
    {
        $fileButton.Enabled = $true
    }
    else
    {
        $fileButton.Enabled = $false
    }
})

$genButton.Add_Click({(Generator)})
$fileButton.Add_Click({$genOutput.Text | Add-Content Keys.txt -NoNewline})

$lInput.Items.AddRange($Locales.Keys)

